import{_ as t,o as r,c as o,z as e,a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 46.2-644 Levy of execution.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-644.md","filePath":"vacode/46.2-644.md"}'),i={name:"vacode/46.2-644.md"},s=e("h1",{id:"§-46-2-644-levy-of-execution",tabindex:"-1"},[a("§ 46.2-644 Levy of execution. "),e("a",{class:"header-anchor",href:"#§-46-2-644-levy-of-execution","aria-label":'Permalink to "§ 46.2-644 Levy of execution."'},"​")],-1),n=e("p",null,"A levy made by virtue of an execution, fieri facias, or other court order, on a motor vehicle, trailer, or semitrailer for which a certificate of title has been issued by the Department, shall constitute a lien, subsequent to security interests previously recorded by the Department and subsequent to security interests in inventory held for sale and perfected as otherwise permitted by law, when the officer making the levy reports to the Department on forms provided by the Department, that the levy has been made and that the motor vehicle, trailer, or semitrailer levied on has been seized by him. If the lien is thereafter satisfied or should the motor vehicle, trailer, or semitrailer thus levied on and seized thereafter be released by the officer, he shall immediately report that fact to the Department. Any owner who, after the levy and seizure by an officer and before the officer reports the levy and seizure to the Department, shall fraudulently assign or transfer his title to or interest in a motor vehicle, trailer, or semitrailer or cause its certificate of title to be assigned or transferred or cause a security interest to be shown on its certificate of title shall be guilty of a Class 1 misdemeanor.",-1),l=e("p",null,"Code 1950, § 46-77; 1958, c. 541, § 46.1-77; 1966, c. 558; 1972, c. 408; 1989, c. 727.",-1),c=[s,n,l];function h(d,f,m,u,y,p){return r(),o("div",null,c)}const b=t(i,[["render",h]]);export{_ as __pageData,b as default};
